// src/Navbar.js
import React from "react"
import company from './company.svg';
import "./Navbar.css";

function Navbar() {
  return (
    <div className="navbar">
      <div className="logo">
        <img src={company}/>
      </div>
      <div className="search-bar">
        {/* Your search bar component goes here */}
      </div>
      <div className="icons">
      <div className="icon">
          &#127968; Home
        </div>
        <div className="icon">
          &#9993; Contact
        </div>
        <div className="icon">
          &#127912; About
        </div>
      </div>
    </div>
  );
}

export default Navbar;
